import React, { Component } from 'react';

export default class Users extends Component {
 
    delete = (id)  => {
      this.props.delete(id);
    }

  render() {
    
    return (
      <div>
        <table className='table table-dark text-white w-75 m-auto mt-5 '>
          <thead className='p-5'>
            <tr>
              <th scope='col'>İD</th>
              <th scope='col'>NAME</th>
              <th scope='col'>LAST-NAME</th>
              <th scope='col'>E-MAİL</th>
              <th scope='col'></th>
            </tr>
          </thead>

          <tbody>
            {this.props.kategori.map(user => (
              <tr key={user.id} scope="row">
                <td scope="row">{user.id}</td>
                <td scope="row">{user.name}</td>
                <td scope="row">{user.lastname}</td>
                <td scope="row">{user.email}</td>
                <td scope="row">
                    <button className='btn btn-danger mb-2' onClick={this.delete.bind(this,user.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}
